export function getTerraExtensions() {
    return Array.isArray(window.terraWallets)
        ? window.terraWallets
        : window.isTerraExtensionAvailable
            ? [
                {
                    name: 'Terra Station',
                    identifier: 'station',
                    icon: 'https://assets.terra.money/icon/station-extension/icon.png',
                },
            ]
            : [];
}
